import React from 'react';
import OSMMap from './Content/OSMMap';
import RegionSelect from './Content/RegionSelect';
import RegionInfo from './Content/RegionInfo';

const Content = () => {
  return (
    <div>
      <OSMMap />
      <RegionSelect />
      <RegionInfo />
    </div>
  );
};

export default Content;
